import React from "react";
import { useState } from "react";
import styles from '../PAGINADO/Paginado.module.css'


function Paginado ({dogsPerPage, dogs, paginado}){ // declaro mi paginado, traigo las props del otro componente
  
  const pageNumber = []

  for (let i = 0; i <= Math.ceil(dogs/dogsPerPage); i++) {
    pageNumber.push(i+1);
  }
  
  const [currentPage, setCurrentPage]= useState(1) 

  const handlePrevClick = () => {
    setCurrentPage(currentPage - 1);
  };

  const handleNextClick = () => {
    setCurrentPage(currentPage + 1);
  };



  return (
    <nav className={styles.nav}>
        <div className={styles.paginado}>
        <div className={styles.number}>
          <button
            type="button"
            disabled={currentPage === 1}
            onClick={handlePrevClick}
          >
            {"<"}
          </button>
        </div>

           {
           pageNumber?.map(number => (
            <div className={styles.number} key={number}>
            <button type="button" onClick={() => paginado(number)} className={currentPage === number ? styles.active : ""}>
              {number} 
            </button>   
          </div>
           ))}
               <div className={styles.number}>
          <button
            type="button"
            disabled={currentPage === pageNumber.length}
            onClick={handleNextClick}
          >
            {">"}
          </button>
        </div>
        </div>
    </nav>
  )
}
export default Paginado;
